r($,"aM9","u4",()=>A.b([A.lz("Application Caf\xe9","D\xe9couvrez \xab\xa0Coffee\xa0\xbb, une application Flutter qui vous invite \xe0 une d\xe9licieuse aventure autour du caf\xe9. Plongez dans un univers riche en ar\xf4mes et en saveurs en parcourant une s\xe9lection exquise de caf\xe9s de sp\xe9cialit\xe9. Gr\xe2ce \xe0 une interface intuitive, explorer diff\xe9rents m\xe9langes et d\xe9couvrir leurs sp\xe9cificit\xe9s devient une exp\xe9rience inoubliable.","assets/images/coffee.png",""),A.lz("Interface d'Application de Contr\xf4le de Voiture","Car Control Dashboard est une application mobile conviviale, d\xe9velopp\xe9e avec Flutter et optimis\xe9e par GetX pour une gestion efficace des \xe9tats. Profitez d'un design moderne et intuitif qui s'adapte \xe0 diff\xe9rentes tailles d'\xe9cran. Interagissez avec les commandes dynamiques de votre voiture, comme la vitesse, la direction et la temp\xe9rature. Des animations r\xe9alistes am\xe9liorent l'esth\xe9tique, vous donnant l'impression de piloter une vraie voiture\xa0!","assets/images/car.png",""),A.lz("Clockify N\xe9omorphique","Neumorphic TimeKit est un projet open source qui allie l'\xe9l\xe9gance d'un syst\xe8me d'alarme au design \xe9l\xe9gant, une horloge analogique au design n\xe9omorphique et un chronom\xe8tre riche en fonctionnalit\xe9s. Que vous recherchiez un outil d'alarme fonctionnel, une horloge de bureau \xe9l\xe9gante ou un chronom\xe8tre pr\xe9cis, TimeKit est fait pour vous.","assets/images/alarm.jpg",""),A.lz("CUI Aider","CUI AIDER est une application exceptionnelle qui allie la r\xe9alit\xe9 augment\xe9e (RA), un portail \xe9tudiant performant, une gestion de cours intuitive et un syst\xe8me complet de notation des moyennes, offrant ainsi une solution compl\xe8te aux \xe9tudiants. Gr\xe2ce \xe0 la technologie de RA, CUI AIDER offre une exp\xe9rience immersive permettant aux utilisateurs d'explorer virtuellement l'int\xe9gralit\xe9 du campus universitaire. Gr\xe2ce \xe0 la RA, les \xe9tudiants peuvent visualiser les b\xe2timents, naviguer gr\xe2ce \xe0 des indications interactives et mieux comprendre leur environnement.","assets/images/cui.png",""),A.lz("Application de Streaming Musical Flutter","Une application de streaming musical Flutter permettant aux utilisateurs de lire des fichiers audio depuis leur stockage local. L'application pr\xe9sente une interface utilisateur intuitive et fluide, offrant une exp\xe9rience utilisateur fluide pour la navigation et la lecture de musique.","assets/images/player.png",""),A.lz("Application de Recettes Culinaires","Ce r\xe9f\xe9rentiel contient une impl\xe9mentation Flutter d'une application de recettes culinaires avec une section d'introduction captivante et des animations impressionnantes. Elle inclut \xe9galement une page d'inscription et de connexion anim\xe9e, pr\xe9sent\xe9e avec \xe9l\xe9gance dans une feuille modale.","assets/images/recipe.png",""),A.lz("Synchronisation de T\xe2ches Pro","Bienvenue dans le r\xe9f\xe9rentiel de la magnifique application de planification de t\xe2ches ! Cette application de gestion de t\xe2ches bas\xe9e sur Flutter combine un design \xe9l\xe9gant avec un backend robuste, garantissant une exp\xe9rience de gestion fluide et organis\xe9e. De l'interface utilisateur \xe9poustouflante \xe0 la synchronisation en temps r\xe9el, cette application r\xe9pond \xe0 tous vos besoins.","assets/images/task.png",""),A.lz("Application de Chat Flutter avec Firebase","Bienvenue dans notre application de chat innovante Flutter ! Cette plateforme de messagerie riche en fonctionnalit\xe9s permet aux utilisateurs de se connecter et de communiquer de mani\xe8re transparente par texte et images. L'application est construite avec Flutter pour le frontend et s'int\xe8gre \xe0 Firebase pour les services backend, y compris l'authentification, la base de donn\xe9es en temps r\xe9el et le stockage.","assets/images/chat.png",""),A.lz("Application de Prise de Rendez-vous M\xe9dicaux","D\xe9couvrez l'extraordinaire \"Syst\xe8me de Prise de Rendez-vous M\xe9dicaux\" - une application Flutter UI de pointe qui red\xe9finit l'accessibilit\xe9 et l'efficacit\xe9 des soins de sant\xe9. Con\xe7ue de mani\xe8re transparente, cette application permet aux utilisateurs de s\xe9lectionner facilement des m\xe9decins par cat\xe9gorie, d'\xe9changer via une messagerie fluide et d'acc\xe9der \xe0 des profils d\xe9taill\xe9s.","assets/images/doctor.png","")],A.Z("v<HX>")))
